import web3 from "./web3";
import Input from './build/Input.json';
import warehouse from './build/warehouse.json';
import container from './build/container.json';

const instance = new web3.eth.Contract(
    JSON.parse(Input.interface),
    '0xF054FbFDeF46c78733092a821B483a4B4f9194A3'
);

const instance_2 = new web3.eth.Contract(
    JSON.parse(warehouse.interface),
    '0xF054FbFDeF46c78733092a821B483a4B4f9194A3'
);

const instance_3 = new web3.eth.Contract(
    JSON.parse(container.interface),
    '0xF054FbFDeF46c78733092a821B483a4B4f9194A3'
);

export default instance; instance_2; instance_3;
